### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the specified requirements. This contract utilizes the `mapping` data structure to store messages and their respective update counts.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping to store messages and their update counts
    mapping (address => mapping (string => Message)) public messages;

    // Struct to represent a message
    struct Message {
        string content;
        uint256 updateCount;
    }

    // Event to notify when a message is updated
    event MessageUpdated(address indexed sender, string message);

    // Function to save a message on the blockchain
    function saveMessage(string memory _message) public {
        // Update the message content
        messages[msg.sender][_message].content = _message;

        // Increment the update count
        messages[msg.sender][_message].updateCount++;

        // Emit an event to notify the message update
        emit MessageUpdated(msg.sender, _message);
    }

    // Function to get the message content
    function getMessage(string memory _message) public view returns (string memory) {
        // Return the message content
        return messages[msg.sender][_message].content;
    }

    // Function to get the update count of a message
    function getUpdateCount(string memory _message) public view returns (uint256) {
        // Return the update count
        return messages[msg.sender][_message].updateCount;
    }
}
```

### Explanation

- **pragma solidity ^0.8.0;**: This line specifies the version of the Solidity compiler to use. In this case, it's version 0.8.0.

- **contract BlockchainMessenger**: This is the name of the contract.

- **mapping (address => mapping (string => Message)) public messages;**: This line declares a mapping to store messages. The outer mapping is keyed by the address of the sender, and the inner mapping is keyed by the message content. The value of each mapping is a `Message` struct.

- **struct Message**: This is a struct to represent a message. It has two fields: `content` to store the message content and `updateCount` to count how many times the message was updated.

- **event MessageUpdated(address indexed sender, string message);**: This line declares an event to notify when a message is updated. The event has two parameters: the sender's address and the updated message.

- **function saveMessage(string memory _message) public**: This function saves a message on the blockchain. It updates the message content, increments the update count, and emits an event to notify the message update.

- **function getMessage(string memory _message) public view returns (string memory)**: This function returns the message content.

- **function getUpdateCount(string memory _message) public view returns (uint256)**: This function returns the update count of a message.

